import { useEffect, useState } from 'react';
import './global.css';
import { useAppTheme } from './hooks/useAppTheme';
import Atom from './pages/Atom';
import Mike from './pages/Mike';

type PageType = 'home' | 'mike' | 'atom';

interface PageInfo {
  id: PageType;
  title: string;
  description: string;
  emoji: string;
}

const pages: PageInfo[] = [
  {
    id: 'mike',
    title: 'Mike Page',
    description:
      'Japanese auction platform with responsive design and CSS modules',
    emoji: 'üè¢',
  },
  {
    id: 'atom',
    title: 'Atom Page',
    description:
      'Japanese auction platform with responsive design and CSS modules',
    emoji: '‚öõÔ∏è',
  },
];

function App() {
  const [currentPage, setCurrentPage] = useState<PageType>('home');
  const { theme, setTheme } = useAppTheme();

  useEffect(() => {
    document.documentElement.setAttribute('data-theme', theme);
  }, [theme]);

  const navigateToPage = (pageId: PageType) => {
    setCurrentPage(pageId);
  };

  const toggleTheme = () => {
    setTheme((prev: string) => (prev === 'light' ? 'dark' : 'light'));
  };

  const renderCurrentPage = () => {
    switch (currentPage) {
      case 'mike':
        return <Mike />;
      case 'atom':
        return <Atom />;
      default:
        return (
          <div className="home-container">
            <header className="home-header">
              <div className="home-header-content">
                <h1>üöÄ React App</h1>
                <p>Choose a page to navigate to:</p>
              </div>
              <button
                onClick={toggleTheme}
                className="btn btn-theme"
                title={`Switch to ${theme === 'light' ? 'Dark' : 'Light'} mode`}
                aria-label={`Switch to ${theme === 'light' ? 'dark' : 'light'} theme`}
              >
                <span aria-hidden="true">
                  {theme === 'light' ? 'üåô' : '‚òÄÔ∏è'}
                </span>
                {theme === 'light' ? 'Dark' : 'Light'}
              </button>
            </header>

            <div className="card-grid">
              {pages.map((page, index) => (
                <div
                  key={page.id}
                  className="page-card"
                  onClick={() => navigateToPage(page.id)}
                  role="button"
                  tabIndex={0}
                  aria-label={`Navigate to ${page.title}`}
                  onKeyDown={e => {
                    if (e.key === 'Enter' || e.key === ' ') {
                      e.preventDefault();
                      navigateToPage(page.id);
                    }
                  }}
                >
                  <div className="page-card-emoji" aria-hidden="true">
                    {page.emoji}
                  </div>
                  <h2 className="page-card-title">{page.title}</h2>
                  <p className="page-card-description">{page.description}</p>
                </div>
              ))}
            </div>
          </div>
        );
    }
  };

  return (
    <div className="app" data-theme={theme}>
      {currentPage !== 'home' && (
        <nav className="nav" role="navigation" aria-label="Main navigation">
          <button
            onClick={() => setCurrentPage('home')}
            className="btn btn-back"
            aria-label="Back to home page"
          >
            <span aria-hidden="true">‚Üê</span>
            Back to Home
          </button>
          <button
            onClick={toggleTheme}
            className="btn btn-theme"
            title={`Switch to ${theme === 'light' ? 'Dark' : 'Light'} mode`}
            aria-label={`Switch to ${theme === 'light' ? 'dark' : 'light'} theme`}
          >
            <span aria-hidden="true">{theme === 'light' ? 'üåô' : '‚òÄÔ∏è'}</span>
            <span className="sr-only">
              {theme === 'light' ? 'Dark' : 'Light'} mode
            </span>
          </button>
        </nav>
      )}

      <main role="main">{renderCurrentPage()}</main>
    </div>
  );
}

export default App;

/**
 * 1. Basic CSS: Mike: ‚úÖ, Atom: ‚ö†Ô∏è
 * 2. Basic React ‚úÖ
 * 3. Flexbox: Mike: ‚úÖ, Atom: ‚ö†Ô∏è
 * 4. HOC concept => Higher Order Component
 * 4. React Hooks: useState, useEffect, useMemo, useCallback, ‚úÖ    useRef
 * 5. Custom Hooks ‚úÖ
 * 6. Context API ‚úÖ
 * 8. TypeScript: Mike
 **/
